import React from 'react'
import './chatroom.css'
const Chatroom = () => {
    return (
        <div className='chatroom'>
            <div className="navbar">
                <div className="navbar_left">An error occurred in the application and your page could not be served. If you are the application owner, check your logs for details. You can do this from the Heroku CLI with the command</div>
            </div>
        </div>
    )
}

export default Chatroom
